export const doctorError = (errorString) => {
  let fixedString;

  fixedString = errorString.replace('GraphQL error: ', '');
  fixedString = errorString.replace('permission denied for table item', "")

  console.log('fixedString');
  console.log(fixedString);

  return fixedString;
};
